import { Button, StyleSheet, Text, View, TextInput } from 'react-native';
import { useEffect, useState } from 'react';

function ClientInfo(params) {
    const [client, setClient] = useState(params.client)
console.log(client)
    return (
        <View>
            <Text>{client.clientName}</Text>
            <Text>{client.rate}</Text>
            <Text>{client.timeLogs}</Text>
            <Text>{client.totaltime}</Text>
            <Text>Contact Info</Text>
            <Text>{client.contactInfo.email}</Text>
            <Text>{client.contactInfo.name}</Text>
            <Text>{client.contactInfo.language}</Text>
            <Text>{client.contactInfo.phone}</Text>
        </View>
    )
}

export default ClientInfo;
